import "./App.css";
import React, { useState, useEffect } from "react";
import Axions from "axios";

function App() {
  const [memberList, setMemberList] = useState([]);
  const [trainerList, setTrainerList] = useState([]);

  useEffect(() => {
    Axions.get("http://localhost:3001/api/getAllMembers").then((response) => {
      setMemberList(response.data);
    });
    Axions.get("http://localhost:3001/api/getAllTrainers").then((response) => {
      setTrainerList(response.data);
    });
  }, []);

  return (
    <div className="App">
      <header className="App-header">
        <h1>Gym Management System</h1>
      </header>
      <div className="btn-grp">
        <button>Members</button>
        <button>Trainers</button>
      </div>
      <div className="tables">
        <table>
          <tr>
            <th>Name</th>
            <th>Address</th>
            <th>Phone</th>
            <th>Email</th>
          </tr>
          {memberList.map((value) => {
            return (
              <tbody key={value.MemberID}>
                <tr>
                  <td>{value.Name}</td>
                  <td>{value.Address}</td>
                  <td>{value.Phone}</td>
                  <td>{value.Email}</td>
                </tr>
              </tbody>
            );
          })}
        </table>
        <table>
          <tr>
            <th>Name</th>
            <th>Address</th>
            <th>Phone</th>
            <th>Email</th>
          </tr>
          {trainerList.map((value) => {
            return (
              <tbody key={value.TrainerID}>
                <tr>
                  <td>{value.Name}</td>
                  <td>{value.Specialization}</td>
                  <td>{value.Phone}</td>
                  <td>{value.Email}</td>
                </tr>
              </tbody>
            );
          })}
        </table>
      </div>
    </div>
  );
}

export default App;
